import React from 'react';

const Projects = () => {
  const projects = [
    { title: 'Spotify TimeBoost', desc: 'Improved listening time for casual users through gamification.' },
    { title: 'Tata Sampann Kids', desc: 'Developed a new kids product line strategy.' },
    { title: 'AmbitionBox Retention Plan', desc: 'Boosted retention with user-centric features.' },
  ];

  return (
    <section id="projects" className="py-20 px-6 bg-black text-white">
      <h2 className="text-4xl font-serif text-primary mb-6">Projects & Case Studies</h2>
      <div className="grid md:grid-cols-2 gap-6">
        {projects.map((proj, idx) => (
          <div 
            key={idx} 
            className="relative border border-primary p-6 rounded-lg hover:shadow-lg cursor-pointer group"
          >
            <h3 className="text-2xl font-serif text-primary mb-2">{proj.title}</h3>
            <p className="group-hover:opacity-0">{proj.desc}</p>
            <p className="absolute inset-0 opacity-0 group-hover:opacity-100 bg-black bg-opacity-75 text-white p-4 rounded-lg">
              More Details Coming Soon...
            </p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
